  const [currentYear] = useState(new Date().getFullYear());
  return (
  <div className='mb-6 flex flex-col gap-6'>
    <div className="">
      <div className="flex items-center justify-center">
        <h2 className='text-3xl font-semibold'>Top {currentYear} 's Pick</h2>
      </div>
    </div>
    <div className="m-5">
      <div className="flex flex-wrap gap-2">

        <Card2 />

      </div>
    </div>
    <Link to="/explore">
      <div className="flex items-center justify-center">Explore More</div>
    </Link>
  </div>
  );
};

export default Home;
